Follow along as Harold Enlow, one of America's foremost caricature carvers, teaches you how to carve faces with life and expression. Enlow shares his woodcarving tips and techniques that make his carvings stand out in this information-packed book. YouÃ¢â‚¬â„¢ll learn to carve a female face, a cowboy face, a Native American face, a Santa face, and more. Best of all, you'll discover Enlow's secret to success: learning how to render highly detailed eyes, lips, nose, hair, and ears before moving on to carving a complete face. Each project is done in small steps that guarantee success. For anyone who wants to learn to carve faces that stand out in a crowd, this is a must-have addition to your woodcarving library.

About the Author
Harold Enlow has written twelve wood carving books and teaches 30-35 woodcarving seminars each year. He is a founding member of Caricature Carvers of America and a member of the National Wood Carvers' Association, the Ozark Whittlers and Wood Carvers, and several other carving groups around the country.
